import './App.css';
import Crud from './Crud.js'
import 'bootstrap/dist/css/bootstrap.min.css';
import CBot from './components/Chatbot/Chatbot';
import { MDBCol } from 'mdb-react-ui-kit';

function App() {
  return (
    <div className="App" class="d-flex align-items-start bg-light mb-3" style={{ height: "100px"}}>
      <MDBCol><Crud/></MDBCol>

      <MDBCol><CBot/></MDBCol>
    </div>
  );
}

export default App;
